import React, { Fragment } from "react";
import GlobalStyle from "../Styles/GlobalStyle";

import Header from "../components/header";
import Main from "../components/main";
import Footer from "../components/footer";

const App = () => {
	return (
		<Fragment>
			<GlobalStyle />
			<Header />
			<Main />
			<Footer />
		</Fragment>
	);
};

export default App;
